import React from 'react';

function ImageGrid({ children, columns }) {
  // Dynamically define the grid columns based on the `columns` prop
  const gridClass = `grid grid-cols-${columns} gap-4 w-full`;

  return (
    <div className={gridClass}>
      {children}
    </div>
  );
}

export default ImageGrid;
